Private Gold 63 - Sex Experiment (2004)

Eight volunteers who answer an advertisement in the newspaper, a doctor with an erotic experiment to perform, a jail where the human specimens will be shut away for ten days...This is the recipe for a blisteringly hot jail sentence that will explore human sexuality to its very limits. Under the microscope in this steamy scientific investigation we have some of the juiciest jailbirds on the planet: Bobbi Eden, Donna Marie, Alexa Mai and Mandy Bright, to name a few, all indulging their filthiest fantasies, dealing out large doses of &quot;penile&quot; servitude to their enthusiastic inmates. The sizzling Sex Experiment spans six succulent scenes of hardcore sex and little by little the strange story unfolds. Wondering what the result is?

Robert Rosenberg, Frank Gunn, Sebastian Barrio, Nika, Mandy Bright, Donna Marie, Steve Hooper, Alexa May, Bobbi Eden

Feature, Foreign

